    true,nt"url": null,nt"notes": "Al-Li alloys are of interest for use in
    aerospace structures due to thendesirable combination of high strength and low density.
    However, highnstrength Al-Li alloys exhibit an intergranular delamination fracturenmode
    which has limited widespread structural applications. Previous worknat NASA LaRC,
    under limited testing, found that the failures tend to benbetween grains of the
    two Brass texture component variants. TaylornFactor calculations show these to have
    severe strain incompatibility.nThese grain orientations are known to develop as
    a preferred orientationnin Al-Li-X-Zr alloys during severe, hot rolling. This program
    willnverify the results and work with Industry to develop an alternative,ndelamination-free
    process.",nt"owner_org": "d8a6202b-c0c3-463d-88a0-3bc021a178ed",nt"extras":
